import React from "react";
import { makeStyles, withStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

import logo from "../React/titlelog.png";
import "./SignUp.scss";

const Zahidfield = withStyles({
  root:
   {width:"100%",
   color: "red",
   marginBottom:"15px",

    "& label.Mui-focused": {
      color: "white",
      borderColor: "white",

    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "white",
    },
    "& .MuiOutlinedInput-root": {
      "& fieldset": {
        borderColor: "black",
      },
      "&:hover fieldset": {
        borderColor: "yellow",
      },
      "&.Mui-focused fieldset": {
        borderColor: "#f16219",
      },
    },
  },
})(TextField);

const SignUp = () => {
  return (
    <>
      <div className="main_container">
        <div className="centrel_div">
          <div className="img">
            <img className="logo_img" src={logo} alt="Error" />
          </div>
          <div className="heading">
            <h3 className="heading_title">Entre Your Details</h3>
          </div>
          <div className="inputs">
            <Zahidfield variant="outlined" id="custom-css-standard-input" label="Full Name" />
            <Zahidfield  variant="outlined"id="custom-css-standard-input" label="Email" />
            <Zahidfield variant="outlined" id="custom-css-standard-input" label="Password" />
            <Zahidfield variant="outlined" id="custom-css-standard-input" label="Confirm Password" />

            <div className="button">
              <button className="submit">CONTINUE</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignUp;
